('1734','15','7522','Finca Stuart Basset (Mutter)',Null,'Sanierter historischer Landsitz aus dem 14. Jahrhundert','20736','Nur 20 km von Palma entfernt, liegt bei Algaida dieser sehr geschmackvoll sanierte Landsitz auf einem ca. 7.000 m² großen Grundstück. Die sorgfältig ausgesuchten Materialien und die moderne Haustechnik machen dieses Anwesen auch ganzjährig bewohnbar. \r\nFünf Schlafzimmer-Suiten, ein großes Wohnzimmer mit Kamin, ein Esszimmer, eine Landhausküche, Gäste-WC, Büroraum, Hauswirtschaftsraum und Abstellraum befinden sich im Haupthaus. Gäste können in dem separaten Gästebungalow beherbergt werden. Ein Gewölbeweinkeller, mit gleichbleibender Temperatur, wartet darauf aufgefüllt zu werden.\r\nIm mediterran bepflanzten Garten erwarten Sie noch ein Pool mit Liegeterrassen sowie ein überdachter Grillplatz.\r\nStrom-, Wasser- und Telefonanschlüsse sind vorhanden. Dieser Landsitz ist noch bis Oktober 2012 vermietet, kann aber zu jeder Zeit besichtigt werden.','20737','2650000','111','2012-02-06 14:34:53','110','2012-02-06 14:35:44',Null,'1292','131','261',1,'1','0',Null,Null,Null,'20738',Null,'0','0','0',Null,'2015-11-05 10:37:07',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'20739',Null,'20740',Null,'20741',Null,'20742',Null,'20743','0',0,'0');
